description:
This DVD is a virtual fireplace that can display 3 different views of a fireplace with or without Christmas music. Burn ISO to DVD using Roxio or Windows (search the web for howto burn ISO image if you need help). If your system is fast enough it can play the ISO directly.

Big Papi hopes you enjoy. Every home should have this playing :^)

- Big Papi



